import React from "react";

import playstore from "../../assets/playstore.png";

const Download = () => {
  return (
    <div id="download">
      <button className="downloadBtn">
        Download <img src={playstore} alt="get it on android" />
      </button>
    </div>
  );
};

export default Download;
